import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import Header from "../Index/Header";
import Navi from "../Index/Main/Navi";
import "./index.css";

interface mainProps{
  match:any;
}
export default class Check extends Component<mainProps> {
  state={
    path:[
      'data:image/png;base64,',
      'data:image/png;base64,',
      'data:image/png;base64,',
      'data:image/png;base64,',
      'data:image/png;base64,',
      'data:image/png;base64,',
      'data:image/png;base64,',

    ],
  }
  url='';
  updateUrl = (path:String) => {
    if(path[52]==='J')
    this.url=this.state.path[1];
    else if(path[52]==='C')
    this.url=this.state.path[4];
    else if(path[52]==='N')
    this.url=this.state.path[5];
    else if(path[63]==='j')
    this.url=this.state.path[6];
    else if(path[135]==='Q')
    this.url=this.state.path[0];
    else if(path[135]==='S')
    this.url=this.state.path[2];
    else if(path[135]==='y')
    this.url=this.state.path[3];
  }
  render() {
    const{name,major,grade,gender,tele,mail,path}=this.props.match.params;
    console.log(path);
    this.updateUrl(path);
    return (
      <div>
        <div>
          <Header />
          <div className="check">
            <Navi />
            <div className='checkback'>
              <NavLink to="/index">人员管理</NavLink>
              /查看详情
            </div>
            <div className='show'>
                头像:<img src={this.url} style={{width:"100%"}}/>
                <br />
                <br />
                姓名：{name}
                <br />
                <br />
                专业：{major}
                <br />
                <br />
                年级：{grade}
                <br />
                <br />
                性别：{gender}
                <br />
                <br />
                电话：{tele}
                <br />
                <br />
                邮箱：{mail}
            </div>
          </div>
        </div>
      </div>
    );
  }
}
